import react from "react";
import { Card } from "antd";

function TestCard() {
  return (
    <div>
      <Card
        headStyle={{ color: "white", background: "#3E3D40" }}
        title={
          <div>
            <b>SSID: </b>Aegis Research
          </div>
        }
        style={{
          display: "flex",
          flexDirection: "column",
          width: "clamp(20rem, calc(20rem + 2vw), 22rem)",
          overflow: "hidden",
          boxShadow: "0 .1rem 1rem rgba(0, 0, 0, 0.1)",
        }}
        bodyStyle={{ background: "#1F1E26" }}
      >
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
        <p>Card content</p>
      </Card>
    </div>
  );
}

export default TestCard;
